/**
 * This package contains implementations for handling indicator data from the World Bank.
 *
 * Key classes:
 * - IndicatorElement: Represents an indicator element.
 * - IndicatorsElement: Represents a collection of indicator elements.
 * - Source: Represents the source of an indicator.
 * - SourceName: Enum representing different source names.
 * - Topic: Represents a topic related to an indicator.
 * - Topics: Represents a collection of topics.
 * - ObjectFactory: Factory class for creating instances of the model classes.
 *
 * Annotations:
 * - @XmlSchema: Defines the XML namespace and element form default for the package.
 */
@javax.xml.bind.annotation.XmlSchema(namespace = "http://indicators.worldbank.external.model.cia.hack23.com/impl", elementFormDefault = javax.xml.bind.annotation.XmlNsForm.QUALIFIED)
package com.hack23.cia.model.external.worldbank.indicators.impl;
